import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import './HomePage.css'; // Importa el archivo CSS
import hgato_comiendo from '../components/hgato_comiendo.jpg'; // Importa la imagen

const HomePage = () => {
    return (
        <div>
            <Navbar />
            <div className="home-container">
                <img src={hgato_comiendo} alt="Nuevo Lanzamiento" className="background-image" />
                <div className="home-content">
                    <p className="home-subtitle">NUEVO LANZAMIENTO</p>
                    <h1 className="home-title">Metálicos a brillar</h1>
                    <p className="home-description">Conoce nuestras nuevas sombras de ojos con un acabado brillante, textura suave y ligera y fijación de 10 horas</p>
                    <Link to="/products">
                        <button className="home-button">Comprar</button>
                    </Link>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
